INSERT INTO `products_installmentsavings` VALUES (1,'WR0001F','우리은행','우리SUPER주거래적금','만기 후\n- 1개월이내 : 만기시점약정이율×50%\n- 1개월초과 6개월이내: 만기시점약정이율×30%\n- 6개월초과 : 만기시점약정이율×20%\n\n※ 만기시점 약정이율 : 일반정기적금 금리','영업점,인터넷,스마트폰,전화(텔레뱅킹)','1. 거래실적 인정기간 동안 우리은행 입출식 계좌에서 아래 각 항목별 실적이 있는 월 수가 계약기간의 1/2이상인 경우\n2. 우리은행 상품서비스 마케팅 동의 항목 중 전화(휴대폰) 및 SMS항목을 모두 동의한 후 만기해지시점까지 유지:연 0.1%p\n3. 이 상품 가입 시 금리우대쿠폰을 적용한 경우','1','실명의 개인'),(2,'WR0001L','우리은행','WON적금','만기 후\n- 1개월이내 : 만기시점약정이율×50%\n- 1개월초과 6개월이내: 만기시점약정이율×30%\n- 6개월초과 : 만기시점약정이율×20%\n\n※ 만기시점 약정이율 : 일반정기적금 금리','스마트폰,전화(텔레뱅킹)','1. 아래 각 항(가, 나)의 조건을 충족하는 경우 합산 최대 연 0.2%p 우대\n가. 이 적금을 우리꿈통장, WON통장에 연결하여 가입하는 경우 : 0.1%p\n나. 우리 오픈뱅킹 서비스에 타행계좌가 등록되어 있는 경우 : 연 0.1%p','1','실명의 개인'),(3,'00266451','한국스탠다드차타드은행','퍼스트가계적금','만기 후 1개월: 약정이율의 50%\n만기 후 1개월 초과 1년 이내: 약정이율의 30%\n만기 후 1년 초과: 약정이율의 10%','영업점,인터넷,스마트폰','없음','1','개인(개인사업자 포함)'),(4,'10521001000846001','아이엠뱅크','내손안에 적금','만기 후 1개월 미만 경과: 약정이자율 x 50%\n만기 후 3개월 미만 경과: 약정이자율 x 25%\n만기 후 3개월 이상 경과: 약정이자율 x 10%','스마트폰','* 최고우대금리 : 연0.55%p\n - 당행 인터넷/모바일뱅킹을 통하여 최초로 적립식예금 가입 시 : 연0.20%p\n - 상품 가입 전 최근 3개월 이내 당행 인터넷/모바일뱅킹을 통한 이체거래 3회 이상 : 연0.10%p\n- 상품 가입 전 수수료우대 통장 보유 고객 : 연0.20%p\n* 해당 상품을 모바일뱅킹을 통해 가입 : 연0.05%p','1','실명의 개인'),(5,'10527001000925000','아이엠뱅크','영플러스적금','만기 후 1개월 미만 경과: 약정이자율 x 50%\n만기 후 3개월 미만 경과: 약정이자율 x 25%\n만기 후 3개월 이상 경과: 약정이자율 x 10%','영업점,인터넷,스마트폰','* 최고우대금리 : 연0.55%p\n- 상품 가입 전 영플러스통장 보유 또는 재예치일 기준 영플러스통장 전월 평잔 10만원 이상 : 연0.10%p\n- 예금기간 중 입금횟수 10회 이상 : 연0.10%p\n- 입학 및 졸업 축하금리 : 연0.30%p\n* 해당 상품을 인터넷/모바일뱅킹을 통해 가입 : 연0.05%p','3','만 29세 이하 실명의 개인'),(6,'10527001001272000','아이엠뱅크','내가만든 보너스적금','만기 후 1개월 미만 경과: 약정이자율 x 50%\n만기 후 3개월 미만 경과: 약정이자율 x 25%\n만기 후 3개월 이상 경과: 약정이자율 x 10%','영업점,인터넷,스마트폰','* 최고우대금리: 연0.80%p\n- 인터넷/모바일뱅킹으로 신규: 연0.20%p\n- 상품 가입 전 마케팅활용[개인(신용)정보수집이용동의] 전체 동의: 연0.20%p\n(계약기간 1년인 경우 만기일 기준)\n- 당행 계좌로 자동이체 8회 이상 입금: 연0.20%p\n- 원금합계 100만원 이상: 연0.10%p 또는 원금합계 200만원 이상: 연0.20%p','1','실명의 개인'),(7,'10527001001278000','아이엠뱅크','iM스마트적금','만기 후 1개월 미만 경과: 약정이자율 x 50%\n만기 후 3개월 미만